Give an improved algorithm that runs in $O(\log n)$ time, using a divide-and-conquer strategy. 
\begin {algorithm}[H] \DontPrintSemicolon \caption {$count$}
\KwIn {arr, x} 
\If {$len(arr) = 1$} {
    \If{$arr[0] == x$} {
    \Return $1$
    } 
    \Else{
    \Return $0$
    }
}
$left \gets arr[:\frac{n}{2}]$\;
$right \gets arr[\frac{n}{2}:n]$\;
\Return $count(left, x) + count(right, x)$
\end{algorithm}
This algorithm recursively splits the array in half until the arrays only have one element. At the base case, if the element is equal to $x$, then we count this as one occurrence. At each step, the number of occurrences from the recursive steps are added together. Since the amount of work to add up the occurrences is $O(1)$, the runtime for \textit{count} can be expressed as
\[T(n) = 2T(\frac{n}{2}) + O(1)\]
Using the Master Theorem gives a runtime of $O(n^0log(n)) = O(log(n))$ as desired.

def swapRows(matrix, m):
    temp = matrix[0]
    for x in range(m):
        if matrix[x][0] != 0:
            matrix[0] = matrix[x]
            matrix[x] = temp
            break;

def LU_Factorization(matrix, swap, U, L):
    m = len(matrix)
    n = len(matrix[0])
    if (matrix[0][0] == 0):
        swapRows(matrix, m)
        swap += 1
    u = []
    for i in range(n):
        u.append(matrix[0][i])
    U.append(u)
    l = []
    for x in range(0, m):
        l.append(int(matrix[x][0] / matrix[0][0]))
        L.append([int(matrix[x][0] / matrix[0][0])]) 

    for i in range(m):
        for j in range(n):
            matrix[i][j] = matrix[i][j] - l[i] * u[j]

\begin {algorithm}[H] \DontPrintSemicolon \caption {Solution}
\KwIn {int n, int m, array P of polynomials} 
\KwOut {product of all given polynomials} 
$i \gets 1$\; 
poly $\gets P[0]$\;
\While {$i < n$}{ 
poly $\gets$ MultiplyPoly(poly, $P[i]$)\; 
$i \gets i+1$\; } 
\Return {poly}
\end{algorithm}

STUDENT_TEST("Compare countZeroSumSubsets to buggyCount") {
    Vector<int> nums = {0, 2, 3, -3, 4, 5};
    EXPECT_EQUAL(countZeroSumSubsets(nums, 0, 0), buggyCount(nums, 0, 0));
    nums = {-3, 2, 3, -3, -4, 5};
    EXPECT_EQUAL(countZeroSumSubsets(nums, 0, 0), buggyCount(nums, 0, 0));
    nums = {0, 0, 3, -3, -4, 25};
    EXPECT_EQUAL(countZeroSumSubsets(nums, 0, 0), buggyCount(nums, 0, 0));
}

