    Vector<int> nums = {1};
    EXPECT_EQUAL(countZeroSumSubsets(nums, 0, 0), buggyCount(nums, 0, 0));
}

int criticalVotesCount(Vector<blockT> blocks, int index, int inputVote, int winSum, int currSum) {
    if (blocks.size() == 0) {
        return 0;
    }

    if (currSum < winSum && inputVote + currSum >= winSum) {
        return 1;
    }

    int withIndex = criticalVotesCount(blocks, index + 1, inputVote, winSum, currSum + blocks[index].count);
    int withoutIndex = criticalVotesCount(blocks, index + 1, inputVote, winSum, currSum);

    return withIndex + withoutIndex;
}

